import React from "react";
import styles from "./HomePage.module.css";
import { Header, Footer, Carousel, SideMenu,ProductCollection, FeaturedClients } from '../../components';
import { Row, Col, Typography } from "antd";
import { productList1, productList2, productList3} from "../../pages/home/mockups";
import sideImgae1 from '../../assets/image/sider_11.png';
import sideImgae2 from '../../assets/image/sider_22.png';
import sideImgae3 from '../../assets/image/sider_33.png';

export class HomePage extends React.Component {
    render() {
        return <>
        <Header />
       <div className={styles['page-content']}>
        <Row style={{marginTop: 20}}>
          <Col span={6}>
            <SideMenu />
          </Col>
          <Col span={18}>
            <Carousel />
          </Col>
        </Row>
        <ProductCollection
          title={<Typography.Title level={3} type="warning">Hottest Choices</Typography.Title>}
          sideImage={sideImgae1}
          products={productList1}
        />
        <ProductCollection
          title={<Typography.Title level={3} type="danger">New Arrival</Typography.Title>}
          sideImage={sideImgae2}
          products={productList2}
        />
        <ProductCollection
          title={<Typography.Title level={3} type="success">Selected</Typography.Title>}
          sideImage={sideImgae3}
          products={productList3}
        />

       </div>
       <FeaturedClients/>
       <Footer />
        </>;
    }
}
